import React, { useState } from 'react'
import { useSelector } from 'react-redux'
import { BudgetsState } from '../reducers/budgetsReducer'
import { AgGridColumn, AgGridReact } from 'ag-grid-react'

import 'ag-grid-community/dist/styles/ag-grid.css'
import 'ag-grid-community/dist/styles/ag-theme-alpine.css'

function Budget() {
  const [gridApi, setGridApi] = useState(null);
  const [gridColumnApi, setGridColumnApi] = useState(null);

  // const [rowData, setRowData] = useState([
  //     { units: 50, cost_per_unit: 10, total_cost: 500 },
  //     { units: 25, cost_per_unit: 10, total_cost: 250 },
  //     { units: 40, cost_per_unit: 20, total_cost: 800 }
  // ])

  const rowData = useSelector<BudgetsState, BudgetsState['budgets']>(
    (state) => state.budgets
  )

  return (
    <div className="ag-theme-alpine" style={{ height: 400, width: 600 }}>
      {/* <h1>Project Budget</h1> */}
      <AgGridReact rowData={rowData}>
        <AgGridColumn field="units"></AgGridColumn>
        <AgGridColumn field="cost_per_unit"></AgGridColumn>
        <AgGridColumn field="total_cost"></AgGridColumn>
      </AgGridReact>
    </div>
  )
}

export default Budget
